　　　　　　　　　　　・入れ歯には毎日雑菌が付着します。<br>
　除菌成分CPC（塩化セチルピリジニウム」・<br>
　漂白成分などを配合しており、毎日付着する<br>
　目に見えない雑菌を効果的に除去し、口臭・<br>
　歯ぐきへの悪影響を予防します。<br>
・しっかり除菌<br>
　除菌成分CPCを配合。除菌率 99.9％<br>
　しっかり除菌・漂白するためには、一晩<br>
　浸けおいてください。 <br>
・高発泡洗浄<br>
　食後の気になる汚れは、5分で洗浄できます。 <br>
・ニオイをとる<br>
　フラボノイドと漂白成分などの作用でニオイ<br>
　を消臭。<br> 　
・ミントの香りで爽快 
