ハブラシでは取れにくい歯と歯の間の歯垢を効果的に取り除きます。お買得３０本入。<br>ハブラシでは取れにくい歯と歯の間の歯垢を効果的に取り除きます。お買得３０本入。<br><br>デンタルフロス ようじタイプ 30本入<br>歯間部の歯垢や食べかすを取り除くフロス(デンタルフロス)です。虫歯や歯周病の原因となる歯と歯の間の歯垢を取り除きます。幅広で持ちやすいグリップになっています。奥歯の裏側や取りにくい食べかすを取り除けるよう、ピック部分は歯の裏側に届きやすいアーチ形状。<br> 使用方法：●歯と歯の間にフロスを入れ、前後に動かしながらゆっくり上下させ、歯垢や食べかすを取り除いてください。<br>●奥歯の裏側や、歯と歯の間の取りにくい食べかすはピック部でお取りください。 使用上の注意●フロスを無理に歯間部に挿入しないでください。歯ぐきを傷つける恐れがあります。<br>●ピック部の先端で歯ぐきを傷つけないよう、ご注意ください。<br>●フロスが歯と歯の間に引っかかったり切れたりする場合は、歯の詰め物が取れていたり、虫歯の恐れもありますので、歯科医にご相談ください。 品質表示●柄の材質：ポリスチレン●フロス(糸)の材質：ナイロン●耐熱温度：80度 <br>原産国：台湾 お問い合わせ先エビス株式会社お客様フリーダイヤル：0120-37-0791 フロス(デンタルフロス)とはデンタルフロスは、ナイロンなどのフィラメントにあわせて作られた歯間掃除用の細い糸です。歯間ブラシでは磨けない狭い歯の隙間に、フロスをスライドさせながら挿入し、歯の隙間の食べカスや歯垢をからめとり除去します。 <br>販売_製造元： エビス<br>ブランド：エビス<br>JAN：4901221025604<br>CS：200<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
